import React from "react";
import YouTubeVideoList from "../YouTubeVideoList";

export default function HighlightsTab({ matchId, matchInfo }) {
  if (!matchInfo) return <div>No highlights available at the moment.</div>;

  if (matchInfo.status === 'NS') {
    const matchName = `${matchInfo?.localteam?.name} vs ${matchInfo?.visitorteam?.name}, ${matchInfo?.round} Match Preview`;
  } else {
    const matchName = `${matchInfo?.localteam?.name} vs ${matchInfo?.visitorteam?.name}, ${matchInfo?.round} Match Highlights`;
  }

  return (
    <div>
      <YouTubeVideoList matchQuery={matchName} />
    </div>
  );
}
